import { Link } from "react-router-dom";



const Header =()=>{


    return(
        <header className="header">
        <nav className="nav-bar">
            <Link className="nav-options" to='/'><FontAwesomeIcon icon="fa-thin fa-calendar-week" /></Link>
            <Link className="nav-options" to='/day'></Link>
            <Link className="nav-options" to='/week'></Link>
            <Link className="nav-options" to='/month'></Link>
            <Link className="nav-options" to='/'>Salir</Link>
        </nav>
    </header>
    )
}

export default Header;
